pragma solidity ^0.4.19;

import "./Libraries/MerklePatriciaProof.sol";

import "./Interfaces/ITrustAnchor.sol";
import "./Interfaces/ITrustAnchorStorage.sol";
import "./Interfaces/ICuratedBinding.sol";

//@note: This is the basis of the trust anchor interfaces that allow for a wallet like Jaxx
// to connect with a third party supplying merkle headers (the "Curated Binding").

// There are a few race conditions to be aware of:

// 1: Users may not have gas of the proper type to perform consent transactions.
// Resolution:
//    We get around this by utilizing the power of the network inflation to fund
//    wallets that don't have enough gas, through the binding process.
//
// 2: Curated bindings owners within the architecture may not have (any) available gas to migrate
//    their users to Shyft.
// Resolution:
//    We get around this by designing the nodes themselves to know if a given binding attestation has
//    occurred, and if not we have funded this contract with gas from the Shyft Conduit specifically
//    for the purpose of allowing a "system pays" mechanism to repay the nodes for the work surrounding
//    the attestation.

// Further thoughts:
//    We may need to integrate both Cache Graph compilation and RMT distribution within the attestation
//    pipleline, and thus require more gas.

contract TrustAnchor_Generic is ITrustAnchor {

    //@note: on the Shyft blockchain, this is funded by the Shyft inflation.
    uint256 contractBalance;
    uint256 minimumRequiredStake;

    address owner = address(0);

    // set up the base jurisdiction. Use the upper end of the addressable jurisdiction space
    // (a 16 bit int) as the "extended mode"; 2^15 = 32768, + offset.
    uint16 ta_jurisdiction = extendedJurisdiction + 1;


    mapping (bytes32 => address) bindingKeccakToIdentifiedAddress;

    //set up addresses to be linked after deployment.
    address trustAnchorStorageAddress;
    address curatedBindingAddress = address(0);
    bytes32 availabilityAddressEncrypted = 0;

    uint256 consentTransactionCost = 0;

    //@note:@todo:@next:@audit: should this contract have "Administrable" style multisig involved for the setting
    // of the contract relationships?

    function isOwner() internal view returns (bool result) {
        if (msg.sender == owner) {
            //is owner
            return true;
        } else {
            //not owner
            return false;
        }
    }

    //returns:
    // 0 = not owner
    // 1 = set trustAnchorStorage

    function setTrustAnchorStorageAddress(address _trustAnchorStorageAddress) public returns (uint8 result) {
        if (isOwner()) {
            require(_trustAnchorStorageAddress != address(0));

            //@note:@todo:@next:@audit: what happens to the existing attestations when we change these relationships?
            // example: 1) should they all be revoked?
            //  or 2) should all of their consent be revoked?
            //  etc.
            trustAnchorStorageAddress = _trustAnchorStorageAddress;

            //set trustAnchorStorageAddress
            return 1;
        } else {
            //not owner
            return 0;
        }
    }

    //returns:
    // 0 = not owner
    // 1 = set curatedBindingAddress

    //@note:@todo:@next:@audit: should this be able to be changed?

    function setCuratedBindingAddress(address _curatedBindingAddress) public returns (uint8 result) {
        if (isOwner()) {
            require(_curatedBindingAddress != address(0));

            curatedBindingAddress  = _curatedBindingAddress;

            //set curatedBindingAddress
            return 1;
        } else {
            //not owner
            return 0;
        }
    }

    function setConsentTransactionCost(uint256 _consentTransactionCost) public {
        if (isOwner()) {
            consentTransactionCost = _consentTransactionCost;
        }
    }

    //setting the encrypted version of this address
    function setAvailabilityAddressEncrypted(bytes32 _availabilityAddressEncrypted) public {
        if (isOwner()) {
            availabilityAddressEncrypted = _availabilityAddressEncrypted;
        }
    }

    //@note: within the constructor, set the minimum stake required such that the Shyft Conduit can
    // be able to know how much to replete for this contract if it's running low on gas to return to
    // benevolent Shyft nodes that have helped with the onboarding.

    constructor(uint256 _minimumRequiredStake) {
        owner = msg.sender;

        //flag that extended mode for jurisdiction is true.
        extendedModeJurisdiction = true;

        minimumRequiredStake = _minimumRequiredStake;
    }



    //@note:@todo:@next: convenience function required to do web3 check for binding not being processed.

    //returns:
    // 0 = proof does not exist.
    // 1 = proof exists.

    function getProofExists(bytes32 bindingKeccak) external returns (uint8 result) {
        if (bindingKeccakToIdentifiedAddress[bindingKeccak] != address(0)) {
            //proof exists.
            return 1;
        } else {
            //proof does not exist.
            return 0;
        }
    }

    //returns:
    // 0 = required external interfaces not set up properly
    // 1 = header doesn't match
    // 2 = proof passes check

    function getProofPassesExternal(bytes _value,
                            bytes _encodedPath,
                            bytes _rlpParentNodes,
                            bytes32 _headerKeccak) public returns (uint8 result) {

        if (trustAnchorStorageAddress != address(0) && curatedBindingAddress != address(0)) {
            ICuratedBinding curatedBinding = ICuratedBinding(curatedBindingAddress);

            bytes32 bindingKeccak = keccak256(abi.encodePacked(_value, _headerKeccak));

            bytes32 merkleHeader = curatedBinding.getMerkleRootFromHeader(_headerKeccak);

            // check the proof against the merkle header
            if (checkProof(_value, _encodedPath, _rlpParentNodes, merkleHeader) == true) {
                //proof passes check
                return 2;
            } else {
                //header doesn't match
                return 1;
            }
        } else {
            //required external interfaces not set up properly
            return 0;
        }
    }

    //returns:
    // 0 = required external interfaces not set up properly
    // 1 = header doesn't match
    // 2 = proof passes check

    function getProofPassesInternal(bytes _value,
                                    bytes _encodedPath,
                                    bytes _rlpParentNodes,
                                    bytes32 _headerKeccak) internal returns (uint8 result) {

        if (trustAnchorStorageAddress != address(0) && curatedBindingAddress != address(0)) {
            ICuratedBinding curatedBinding = ICuratedBinding(curatedBindingAddress);

            //@note: don't involve the _identifiedAddress in the check, since a proof can only
            // be bound once in any case.

            bytes32 bindingKeccak = keccak256(abi.encodePacked(_value, _headerKeccak));

            bytes32 merkleHeader = curatedBinding.getMerkleRootFromHeader(_headerKeccak);

            // check the proof against the merkle header
            if (checkProof(_value, _encodedPath, _rlpParentNodes, merkleHeader) == true) {
                //proof passes check
                return 2;
            } else {
                //invalid proof
                return 1;
            }
        } else {
            //required external interfaces not set up properly
            return 0;
        }
    }

    //@note: This function attests on a user's behalf. It is gas-neutral, with a return of gas to
    // the caller.

    //@note:@todo: check for gas?

    //returns:
    // 0 = required external interfaces not set up properly
    // 1 = proof doesn't pass check
    // 2 = address has already been bound to this binding keccak
    // 3 = properly set attestation, bound to address

    function proveForIdentifiedAddress( address _identifiedAddress,
                                        bytes _value,
                                        bytes _encodedPath,
                                        bytes _rlpParentNodes,
                                        bytes32 _headerKeccak) public returns (uint8 result) {
        if (trustAnchorStorageAddress != address(0)) {
            if (getProofPassesInternal(_value, _encodedPath, _rlpParentNodes, _headerKeccak) == 2) {
                ITrustAnchorStorage trustAnchorStorage = ITrustAnchorStorage(trustAnchorStorageAddress);
                ICuratedBinding curatedBinding = ICuratedBinding(curatedBindingAddress);

                //@note: don't involve the _identifiedAddress in the check, since a proof can only
                // be bound once in any case.

                bytes32 bindingKeccak = keccak256(abi.encodePacked(_value, _headerKeccak));

                // make sure this proof can only be bound once.
                if (bindingKeccakToIdentifiedAddress[bindingKeccak] == address(0)) {
                    // get the merkle header, and the channel form from the curated binding contract.
                    bytes32 merkleHeader = curatedBinding.getMerkleRootFromHeader(_headerKeccak);
                    uint256 channelForm = curatedBinding.getChannelFormFromHeader(_headerKeccak);

                    bytes memory publicData = hex"ff";
                    bytes memory documentsMatrixEncrypted = hex"ff";
                    bytes32 attestationAvailabilityAddressEncrypted = availabilityAddressEncrypted;

                    // sets the attestation as coming from this source
                    trustAnchorStorage.setAttestation(  _identifiedAddress,
                                                        ta_jurisdiction,
                                                        0,
                                                        (2**64 - 1),
                                                        publicData,
                                                        documentsMatrixEncrypted,
                                                        attestationAvailabilityAddressEncrypted,
                                                        false);

                    bindingKeccakToIdentifiedAddress[bindingKeccak] = msg.sender;

                    //@note:@here:@audit: confirm this is safe for re-entry given that the bindingKeccakToIdentifiedAddress is
                    // set just above, and checked preceding that.
                    addGasToIdentifiedAddressIfNecessary(_identifiedAddress);

                    //properly set attestation, bound to address
                    return 3;
                } else {
                    //address has already been bound to this binding keccak
                    return 2;
                }
            } else {
                //proof doesn't pass check
                return 1;
            }
        } else {
            //required external interfaces not set up properly
            return 0;
        }
    }

    //@note:@here:@critical:@audit: could someone game the system and withdraw the 3x consent gas,
    // then immediately onboard again, and so on? Maybe it's fine to do so, since each onboarding would
    // require a consent message to be sent anyhow.

    //returns:
    // 0 = no need to add gas
    // 1 = added gas

    function addGasToIdentifiedAddressIfNecessary(address _identifiedAddress) internal returns (uint8 result) {
        uint256 consentAllowance = consentTransactionCost * 3;

        // skip function if consentTransactionCost is set to zero.
        if (consentTransactionCost == 0 || _identifiedAddress.balance < consentAllowance) {
            uint256 gasRequired = consentAllowance - _identifiedAddress.balance;

            _identifiedAddress.transfer(gasRequired);

            //added gas
            return 1;
        } else {
            //no need to add gas
            return 0;
        }
    }


    //@note:@todo:@next: fill out these stubs.
    //@note: this function is able to be called publicly given the distributed
    //

    function revokeProof() public returns (uint8 result) {
        return 0;
    }

    //returns:
    // false = invalid proof
    // true = valid proof

    function checkProof(bytes _value, bytes _encodedPath, bytes _rlpParentNodes, bytes32 _root) internal returns (bool success) {
        if (MerklePatriciaProof.verify(_value, _encodedPath, _rlpParentNodes, _root) == true) {
            //valid proof
            return true;
        } else {
            //invalid proof
            return false;
        }
    }
}
